package id389_FindtheDifference;

public class Solution {
	public char findTheDifference(String s, String t) {
		int[] a = new int[26];
		int lens = s.length(), lent = t.length(), i;
		for (i = 0; i < lens; i++)
			a[s.charAt(i) - 'a']++;
		for (i = 0; i < lent; i++)
			if (a[t.charAt(i) - 'a'] <= 0)
				break;
			else
				a[t.charAt(i) - 'a']--;
		return t.charAt(i);
	}

	public static void main(String[] args) {
		Solution solution = new Solution();
		int[] data = { 2, 2, 1 };
		String s = "";
		String t = "";
		char re = solution.findTheDifference(s, t);
		System.out.println(re);

	}
}